// any css-accepted format
export const accent_color = "#A31F34";

export const name = "John Doe";

export const introduction = <div>
  <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Eget mi proin sed libero enim sed faucibus turpis. Mauris ultrices eros in cursus turpis. Sed faucibus turpis in eu mi bibendum neque egestas.</p>
  <p>I earned my Bachelor's with high distinction and departmental honors in Computer Science and Mathematics from <a href="https://www.hmc.edu/about/">Harvey Mudd College</a>, where I worked with <a href="https://www.linkedin.com/in/georgemontanez/">George Monta&ntilde;ez</a> in the <a href="https://www.cs.hmc.edu/~montanez/amistad.html">AMISTAD lab</a>. My work was supported by the <a href="https://www.hmc.edu/about/2022/08/12/harvey-mudd-college-2022-astronaut-scholars/">Astronaut Scholarship</a> and earned the <a href="https://cra.org/2022-outstanding-undergraduate-researcher-award-recipients/">CRA Outstanding Undergraduate Researcher Award</a>.</p>
</div>;

// icons from fontawesome 6.1.1 (free), or academicons (https://jpswalsh.github.io/academicons/)
export const icons = [
  {
    className: "ai ai-cv",
    link: process.env.PUBLIC_URL + '/temp_cv.pdf'
  },
  {
    className: "ai ai-semantic-scholar",
    link: "https://www.semanticscholar.org/"
  },
  {
    className: "fa-brands fa-google",
    link: "https://scholar.google.com/"
  },
  {
    className: "fab fa-linkedin-in",
    link: "https://www.linkedin.com/"
  },
  {
    className: "fa-brands fa-twitter",
    link: "https://twitter.com/"
  },
  {
    className: "fas fa-paper-plane",
    link: "mailto:johndoe@university.edu"
  }
];
